Science Documentary hosted by Dr. Phil Manning, published by National Geographic in 2011 - English narration


Information
------------------------------

Jurassic CSI
In Jurassic CSI, dino detective Dr. Phil Manning launches a fullscale investigation to unearth how dinosaurs really looked and lived. Jurassic CSI goes into the minds, under the skin and inside the bones of the biggest, most impressive beasts ever to walk the planet.
In this six-part series, Dr. Manning doesn't stick to convention or even his own discipline on his perpetual quest to expand what we know about dinosaurs. With privileged access to some of the world's most sophisticated technologies from crime scene 3D mapping technology to an image machine one million times stronger than a chest X-ray Jurassic CSI challenges long held assumptions and poses radical questions about our understanding of dinosaurs.
* Programmes contain strong language in places.


1)  Episode 1: Inside T.Rex 
T. rex was king of the Cretaceous. He certainly had the weapons, but did he have the smarts? An unorthodox palaeontologist attempts to unlock secrets hidden inside the brain of this apex predator.

2)  Episode 2: Walk like a Dinosaur 
Armed with a high tech crime scene tool, Phil Manning sets out on a journey to find out how dinosaurs may have walked... and maybe even how they ran.

3)  Episode 3: In Living Colour 
Using forensic technology and one of the world's most precise imaging machines, can palaeontologist Phil Manning determine the colour of dinosaurs from fossils?

4)  Episode 4: T Rex Trauma 
How did dinosaurs heal so well in the rough and tumble world of the Cretaceous? Phil Manning uses the largest T. rex ever found to try and figure it out

5)  Episode 5: Supersize 
Giant dinosaurs seemed to defy physical laws to become the biggest land animals ever. Phil Manning asks if there are even bigger dinosaurs still out there waiting to be unearthed.

6)  Episode 6: Skin Deep 
What did dinosaurs really look like? Unorthodox palaeontologist Phil Manning uses new forensic technology to put scientifically accurate skin on a dinosaur, revealing how they lived and behaved.

